import axios from 'axios';

const KEY = 'AIzaSyC7W3__JxEL2jWPmaMEYHovprNoK6XXQyI';

export default axios.create({
    baseURL: 'https://www.googleapis.com/youtube/v3',
    params: {
        part: 'snippet',
        type: 'video',
        maxResults: 1,
        key: KEY
        // Don't put q: here for querying because we only want to call it when we need it (reusability)
    }
});
